import React from "react";
import "./VideoDetails.scss";
import HeroDetailCard from "../hero-detail-card/HeroDetailCard";

export default function HeroVideoDetails(props) {
  return (
    <section className="hero-detail-section">
      {props.video.map((detail) => {
        return <HeroDetailCard key={detail.title} />;
      })}
    </section>
  );
}
